import React, { Component } from 'react';
class Genre extends Component {
    render() { 
        return <div>
            <br /> <br />

            <ul class="list-group">
            <li class="list-group-item">Action</li>
            <li class="list-group-item">Comedy</li>
            <li class="list-group-item">thrilled</li>
            <li class="list-group-item">A fourth item</li>
            <li class="list-group-item">And a fifth one</li>
            </ul>
            <div className="list-group">
            <a href="!#" className="list-group-item list-group-item-action active" aria-current="true">
                Action
            </a>
            <a href="!#" className="list-group-item list-group-item-action">Comedy</a>
            <a href="!#"  className="list-group-item list-group-item-action">Thrilled</a>

            </div>
        </div>;
    }
}

export default Genre;
